import { Footer } from './Footer.js';
import './style.css';

export class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Navigation />
          <Switch>
            <Route path='/home' component={HomePage} />
            <Route path='/about' component={AboutPage} />
          </Switch>
          <Footer />
        </Router>
      </div>
    );
  }
}

export default App;
